    <Card>
      <Card.Body>
        <Nav className="flex-sm-column align-items-center">
          <Nav.Link href="/"><HouseFill /></Nav.Link>
          <Nav.Link href="#"><GraphDownArrow /></Nav.Link>
          <Nav.Link href="#"><CardList /></Nav.Link>
          <Nav.Link href="#"><PlusCircle /></Nav.Link>
          <Nav.Link href="#"><PersonFill /></Nav.Link>
        </Nav>
      </Card.Body>
    </Card>
  );
}

export default Sidebar;
